import './App.css';
import Board from './functions.js';

function App() {

  function restart(){
    window.location.reload();
  }

  return (
    <div className="board-container">
      <div>
        <h1>Tic-Tac-Toe Game</h1>
        <Board/>
        <button type="button" onClick={ restart }> <span>Restart Game</span> </button>
      </div>
    </div>
  );

}

export default App;
